import './styles/App.css';
import Navbar from './components/Navbar'
import ApartmentView from './components/ApartmentView'
import Map from './components/AutoSearch'
import React, { useState, useEffect } from "react"
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Landing from './components/Landing';
import AutoSearch from './components/AutoSearch';

function App() {
  const [address, setAddress] = useState('')
  const [coordinates, setCoordinates] = useState({
    lat: null,
    lng: null,
  });

  //NEW CODE
  // useEffect(() => {
  //   // props.updateAddress(address)
  //   // props.updateCoordinates(coordinates)
  //   updateAddress(localStorage.getItem('address'))
  //   updateCoordinates(localStorage.getItem('coords'))
  // }, [address])

  function updateAddress(newAddress) {
    console.log('getting child address in app.js:', newAddress)
    setAddress(address => newAddress)
  }

  function updateCoordinates(newCoord) {
    console.log('getting child coordinates in app.js:', newCoord)
    // setCoordinates(coordinates => newCoord)
    setCoordinates(coordinates => ({
      lat: newCoord.lat,
      lng: newCoord.lng
    }));
  }

  return (
    <div className="App">
      <Router>
        <Routes className='routes'>
          <Route exact path="/" element={<Landing updateAddress={updateAddress} updateCoordinates={updateCoordinates} />} />
          <Route exact path="/apartment-view" element={<ApartmentView address={address} coordinates={coordinates} />} />
        </Routes>
      </Router>
    </div>
  );
}

